Primality proof for n = 353:
<p>Take b = 3.
<p>b^(n-1) mod n = 1.
<p><a href=11.html>11 is prime.</a>
<br>b^((n-1)/11)-1 mod n = 139, which is a unit, inverse 160.
<p><a href=2.html>2 is prime.</a>
<br>b^((n-1)/2)-1 mod n = 351, which is a unit, inverse 176.
<p>(2^5 * 11) divides n-1.
<p>(2^5 * 11)^2 > n.
<p>n is prime by Pocklington's theorem.
